ementalPCA(n_components=2,copy=False, svd_solver='randomized')\n            pca.fit(arrays)\n        else:\n           pca.partial_fit(arrays)\n\n        arrays=None\n        toc1 = time.perf_counter()\n        perf[g//timeStep][3] = toc1 - tic1  \n        toc3 = time.perf_counter()\n        perf[g//timeStep][0] = toc3 - tic3\n\n\n\nprint(\"pca, \", pca, flush=True)\nResults.append([pca.explained_variance_ , pca.singular_values_])\ntp = time.perf_counter()\nprint(\"Total time to Dask solution is \", tp-t)\n\npperf = pd.DataFrame(perf,columns=['generation', 'getdata', 'getdataq', 'computation'])\npdata = pd.DataFrame(Results,columns=[ 'his', 'bins'])\n\nwith open(\"perf.csv\", \"a\") as fperf:\n    pperf.to_csv(fperf, encoding='utf-8', index=False)\n    \nwith open(\"diag.csv\", \"a\") as fdiag:\n    pdata.to_csv(fdiag, encoding='utf-8', index=False)\n    \nC.Finalization()\n    \n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"line_alpha":0.1,"line_color":"blue","x":{"field":"time"},"y":{"field":"write_bytes"}},"id":"1338","type":"Line"},{"attributes":{"source":{"id":"1002"}},"id":"1035","type":"CDSView"},{"attributes":{"data":{"bandwidth":{"__ndarray__":"ANumhKRYukG43Tt/E+i6QbX4O5TRibhBas55kiIyvkFV/CRi8LaxQTddwpnKYbNBmrM79v2kv0E8lmT2mAXFQX7JYKOiy7RByMGcXv24wkHOhgM32fLBQXSyfPVQF7ZBQRUC0bhVvkFxTd59rzaIQTr4iZMK0a9BgeFr/+oBq0EY3MJ8BHaJQUyinPX6baxBnE04EGusu0EoH41bz5G4QdRgJT2NNpJBxApnpN/fqkHBWhvLU0hFQZt3itT+YL9B4jiviXEztEHygYy3vaugQdF6ygx4YLtB4y/UgmmTzEEMgCnRsKm4QcoOEx5vDZ5BIxkOEMZQuEEtuT+bfX2TQUql46uCwl9BsFMZR6QLR0GXpor4PX61QQybGHBKgKlBBFHyD5yaskEEJy8ygoRgQR79WkPVpahBkbP8zjw5YEG2ZTdT9L23QTOMmtu5ZrJBEmyKTx5TpUHgl1UuSD6uQTl2ac0K+r1By9cyUsOtsEFVChZmqiWxQWVR0HEyn6xBjEIAbXYAtEGOSR5z49ytQXJ3cN1LL7JBwzjfDCdrsUG6elGROLK4Qag5+1UqdY5BejayVMpat0EZaGlKb6KwQcVIngAYGMZBDeZ98leFs0FB6MJVlk1iQeXAoWpTI8FBmj7JdZU3wEEZDCg1DwJQQYWAXtDlEkZBdt7JfixKxEF09JyFFp2iQetmYZZInbtBVQszkUkngEEPi+b5IpmuQYva/d83+5tB9evi1bqPtkFg5qF0xQhHQUvRSRqUb7VBDpnjuhf7tEHFRJd1oyGqQS8Ul80
